import { FaTimes } from 'react-icons/fa'

const Game = ({ task, onDelete, onToggle }) => {
  return (
    <div>
      <h3>
        {task.text}{' '}
        <FaTimes
          style={{ color: 'red', cursor: 'pointer' }}
          onClick={() => onDelete(task.id)}
        />
      </h3>
      <p>{task.day}</p>
    </div>
  )
}

export default Game
